```r

head(bzh_methan_id)

## Comment inverser des coordonnées ?
### Pas de fonction simple : édition &quot;directe&quot; des géométries


```r
# Travail sur le shape de base
bzh_pra &lt;- st_read(&quot;raw_data/shapefile/pra_bzh.shp&quot;, quiet = TRUE, options = &quot;ENCODING=WINDOWS-1252&quot;,) 
bzh_pra_YX &lt;- bzh_pra # Copie du shape
# Print de la structure de la colonne &quot;geometry&quot;
# str(bzh_pra_YX$geometry)
# Chaque petite région agricole
for(n_pra in 1:length(bzh_pra_YX$geometry)){ 
  # Chaque petite région agricole est un multi-polygone (cas île, exclave etc.)
  for(poly in 1:length(bzh_pra_YX$geometry[[n_pra]]))
    # Chaque polygone peut avoir plusieurs listes de formes (cas trou)
    for(forme in 1:length(bzh_pra_YX$geometry[[n_pra]][[poly]]))
    {
      #Inversion des colonne X et Y (enfin)
      bzh_pra$geometry[[n_pra]][[poly]][[forme]][, 1] &lt;- 
        bzh_pra_YX$geometry[[n_pra]][[poly]][[forme]][, 2]
      bzh_pra$geometry[[n_pra]][[poly]][[forme]][, 2] &lt;- 
        bzh_pra_YX$geometry[[n_pra]][[poly]][[forme]][, 1]
    }
}
```

## Opérations geométriques, exemple : 
En Bretagne, délimiter les zones qui se situent **à la fois** à plus de 25 km des frontières de la Bretagne et à moins de 10 km d&#39;un méthaniseur

---
## Jointures par attribut
### dplyr::inner_join(), left_join() ...

- ** Très utile pour joindre des données non spatialisés (exemple feuille excel) à une couche spatialisée. ** Pour ce faire, ces deux fichiers de données doivent partager une information en commun (clé) qui permet de réaliser la jointure.

![](data:image/png;base64,#image/sf/join-venn.png)

- Il existe plusieurs types de jointures. Les jointures type &quot;INNER JOIN&quot; et &quot;LEFT JOIN&quot; sont les plus courantes.
- Plus d&#39;information sur les jointures :
- Illustration : https://www.garrickadenbuie.com/project/tidyexplain/
- Tous les type de jointures expliquées en détail : https://r4ds.had.co.nz/relational-data.html

---
## Jointures par attribut
### dplyr::inner_join()

.center[
![:scale 40%](data:image/png;base64,#image/sf/inner-join.gif)
]
On ne garde **que** les lignes présentes dans les **deux** jeux de données

.footnote[https://www.garrickadenbuie.com/project/tidyexplain/]

---
## Jointures par attribut
### dplyr::left_join()
.center[
![:scale 40%](data:image/png;base64,#image/sf/left-join.gif)
]

Les lignes présentes dans le jeu de données `x` sont gardées même si elles sont absentes de `y`.
C&#39;est utile pour ne pas effacer des lignes de notre objet sf ...

.footnote[https://www.garrickadenbuie.com/project/tidyexplain/]

---
## Jointures par attribut
### dplyr::left_join(), cas particulier

.center[
![:scale 40%](data:image/png;base64,#image/sf/left-join-extra.gif)
]
Si `y` est présent plusieurs fois pour chaque `x`, alors la ligne est dupliquée autant de fois que nécessaire. Pratique mais attention (mémoire).

.footnote[https://www.garrickadenbuie.com/project/tidyexplain/]

---

## Jointure spatiale
### sf::st_join()
  - ** Très utile pour joindre des données spatialisés mais qui ne possèdent pas de clé en commun ** La jointure est réalisée à partir du géoréférencement des couches.


```r
bzh_pra &lt;- bzh_pra %&gt;% st_transform(2154)
pra_metha &lt;- st_join(x = bzh_methan,
                     y = bzh_pra,
                     join = st_covered_by)
```

- Si &quot;join&quot; n&#39;est pas précisé, par défaut = `st_intersects`
- Attention à l&#39;ordre des couches et au résultat attendu. Il est facile de produire des `sfc` extrêmement volumineux et/ou d&#39;avoir des temps de calculs élevés.
- Alternative : usage d&#39;une opération de &quot;sélection géométrique&quot;, puis jointure par attribut

### Exemple : calcul de statistiques sur les méthaniseurs par Petite Région Agricole, puis jointure par attribut
.small-code[

```r
# Calcul du nombre de méthaniseurs et de la puissance installée par PRA
pra_met_summary &lt;- pra_metha %&gt;% 
* st_drop_geometry() %&gt;%
  group_by(NOM_PRA) %&gt;%
* summarise(n = n(),
            p_kwe_tot = sum(p_kwe, na.rm = TRUE))

# Calcul de l&#39;aire par PRA
bzh_pra &lt;- bzh_pra %&gt;%
* group_by(NOM_PRA) %&gt;% # equivalent &quot;dissolve by feature&quot;
* summarise() %&gt;%
  mutate(area = st_area(.)) # https://magrittr.tidyverse.org/reference/pipe.html

# Jointure par attribut et calcul de densités
pra_met_sf &lt;- 
* left_join(bzh_pra, pra_met_summary, by = &quot;NOM_PRA&quot;) %&gt;%
* mutate(area_km2 = as.numeric(area)/1e6,
         n_1000km2 = n/area_km2*1000,
         p_kwe_km2 = p_kwe_tot/area_km2) 
```
]

<script>remark.macros.scale = function(w) {
  var url = this;
  return '<img src="' + url + '" style="width: ' + w + '" />';
};</script>
<script>var slideshow = remark.create({
"highlightStyle": "github",
"highlightLines": true,
"countIncrementalSlides": false
});
if (window.HTMLWidgets) slideshow.on('afterShowSlide', function (slide) {
  window.dispatchEvent(new Event('resize'));
});
(function(d) {
  var s = d.createElement("style"), r = d.querySelector(".remark-slide-scaler");
  if (!r) return;
